def solve(t1, t2):
    union = t1 + t2
    return tuple(set(union))

def solve(tup1, tup2):
    union = set(tup1).union(set(tup2))
    return tuple(union)

def solve(tuples):
    union = set()
    for tuple in tuples:
        union = union.union(set(tuple))
    return union

def solve(tuples):
    union = []
    for t in tuples:
        for num in t:
            if num not in union:
                union.append(num)
    return union
